import React, { Component } from "react";
import "./App.css";
import Navbar from "./components/navbar";
import Counter from "./components/counter";

class App extends Component {
  render() {
    return (
      <React.fragment>
        <Navbar />
        <main className="container">
          <Counter />
        </main>
      </React.fragment>
    );
  }
}

export default App;
